import Change_component from './Change_component'
import Home_component from './Home_component'
import Home_component2 from './Home_component2'
import {BrowserRouter, Routes, Route, Link} from "react-router-dom"


function App() {
  return (
    <div className="App">
        <Home_component2/>


        <Route exact path='/' Component={Home_component2}/> 
        <Route exact path='/menu' Component={Change_component}/>


    </div>
  );
}

export default App;
